import React from "react";
import Heading from "./Heading";

function List(props){
    return <div>
        <Heading />
        <ul>
            <li>{props.name}</li>
            <li>Audi</li>
            <li>Mercedese-Benz</li>
        </ul>
    </div>;
}

export default List;
